import React from 'react';
import Highcharts from 'highcharts/highstock'
import HighchartsExporting from 'highcharts/modules/exporting'

import ChartLine from '@screens/Home/components/ChartLine';
import ChartBar from '@screens/Home/components/ChartBar';


if (typeof Highcharts === 'object') {
  HighchartsExporting(Highcharts)
}

const chartOptions = {
  title: {
    text: 'Teste'
  },
  series: [{
    data: [1,2,3, 10],

  }]
}

const chartOptionsBar = {
  chart: {
    type: 'column'
},
  title: {
    text: 'Teste'
  },
  series: [{
    data: [
      {
          name: "Chrome",
          y: 62.74,
          drilldown: "Chrome"
      },
      {
          name: "Firefox",
          y: 10.57,
          drilldown: "Firefox"
      },
      {
          name: "Internet Explorer",
          y: 7.23,
          drilldown: "Internet Explorer"
      },
      {
          name: "Safari",
          y: 5.58,
          drilldown: "Safari"
      },
      {
          name: "Edge",
          y: 4.02,
          drilldown: "Edge"
      },
      {
          name: "Opera",
          y: 1.92,
          drilldown: "Opera"
      },
      {
          name: "Other",
          y: 7.62,
          drilldown: null
      }
  ],

  }]
}

const data = [1,2,3,4,5];


/**
 * @exports
 * @function
 * @components HomeScreen
 * @param {string} id
 * @namespace screens screens/Workflow
 *
 * @description
 * Respons치vel pela p치gina de montagem do workflow.
 */
export const ChartPage: React.FC = () => (
  <>
    <ChartLine options={chartOptions} highcharts={Highcharts}/>
    <div>
      {data.map(()=>{
        return <ChartBar options={chartOptionsBar} highcharts={Highcharts}/>
      })}

    </div>
  </>
);
